description:
BBC 1 
Thursday, December 16th, 2010
8:00pm to 10:00pm



Award-winning comedian Michael McIntyre hosts the 82nd annual Royal Variety Performance, where the cream of music, comedy and theatre come together in the presence of Their Royal Highnesses, The Prince of Wales and The Duchess of Cornwall, at the iconic London Palladium.

Performers include Take That, Kylie Minogue, Cheryl Cole, N-Dubz, Russell Watson, The Chelsea Pensioners, The Wizard Of Oz, Les Miserables, plus comedians John Bishop, Sarah Millican, Jack Whitehall and Micky Flanagan. And, of course, Britain's Got Talent winners Spelbound.



